import React from 'react'
import alunos from '../../data/alunos'

export default (props) => {


    const li1 = (
        <li>
            {alunos[0].id}) {alunos[0].nome} -&gt; {alunos[0].nota}
        </li>
    );

    const lis = alunos.map((aluno) => {
        return(
            <li>{aluno.id})</li>
        );
    });
    return (
        <div>
            <ul>
                {lis}
                <li>Carlos - 7.7</li>
                <li>Daniel - 6.5</li>
            </ul>
        </div>
    );
}
